Medicino aŭ kuracarto (dubindaj vortoj: sanscienco, sanoscienco, kuracscienco) estas la scienco kaj arto pri la sano de homoj kaj bestoj; ĝi aparte okupiĝas pri esplorado, diagnozo, traktado kaj preventado de malsanoj. La vorto medicino estas derivita el la latina medicus, signife "kuracisto". El la sama radiko devenas la vortoj medicinaĵo (kuracilo) kaj medicinisto (kuracisto). Medicino enhavas varion de sanzorgaj praktikoj evoluintaj al elteno kaj restaŭrado de sano fare de preventado kaj traktado de malsano. Medicino estas tre vasta studfako, kiu inkluzivas plurajn subfakojn kaj branĉojn. Oni kutimas distingi: 
* La bazaj medicinaj sciencoj estas tiuj, pri kiuj ĉiuj medicinistoj estas edukitaj; 
* La branĉoj de medicino estas specifaj fakoj, pri kiuj eblas fakiĝi post la ĝeneralaj studoj pri medicino; 
* La interdisciplinaj branĉoj estas tiuj fakoj, kiuj konsistas el miksiĝo de pluraj medicinaj branĉoj. Nuntempa medicino aplikas biomedicinon, genetikon kaj medicinan teknologion al diagnozo, traktado, kaj preventado de vundoj kaj malsanoj, tipe pere de kuraciloj aŭ kirurgio, sed ankaŭ pere de terapioj tiom diversaj kiel psikoterapio, ortopedio, proteziko, biofarmacio, kaj iona radiado, inter aliaj. Medicino ekzistis dum miloj da jaroj, dum plej el kiuj ĝi estis arto (areo de lertecoj kaj konoj) ofte havante konektojn kun la religiaj kaj filozofiaj kredoj de loka kulturo. Ekzemplo, kuraculo aplikus herbojn kaj dirus preĝojn por kuracado, aŭ antikva filozofo kaj kuracisto aplikus sangeltiron laŭ la teorioj de humorismo. En pli ĵusaj jarcentoj, ekde la alveno de scienco, plej parto de medicino iĝis kombinaĵo de arto kaj scienco (kaj baza kaj aplikata, laŭ la terminego medicina scienco). Dum kudrotekniko por kudrado estas arto lernita pere de praktiko, la kono de kio okazas ĉe la ĉela kaj molekula niveloj en la histoj kudrataj pliboniĝas danke al la scienco. Prasciencaj formoj de medicino estas nuntempe konataj kiel tradicia medicino kaj popola medicino. Ili restas ofte uzata kun aŭ anstataŭ scienca medicino kaj estas tiele nomitaj kiel alternativa medicino. Ekzemple, pruvaro pri la efiko de akupunkturo estas "varia kaj nekonsistanta" por ajna kondiĉo, sed estas ĝenerale sekura kiam farita de taŭga trejnita praktikisto. Kontraste, traktado ekster la limoj de la sekureco kaj de la efikeco estas terminigita kiel ĉarlatanismo.
